/** Symbolic definitions of all the tokens that the 
lexer
 will work with.
 * \{
 *
 * Antlr will define EOF, but we can't use that as it it is too common in
 * in C header files and that would be confusing. There is no way to filter this out at the moment
 * so we just undef it here for now. That isn't the value we get back from C recognizers
 * anyway. We are looking for ANTLR3_TOKEN_EOF.
 */
#ifdef	EOF
#undef	EOF
#endif
#ifdef	Tokens
#undef	Tokens
#endif
#define EOF      -1
#define ASCII_SYMBOL      4
#define BACKUP_SYMBOL      5
#define BEGIN_SYMBOL      6
#define BYTE_SYMBOL      7
#define CACHE_SYMBOL      8
#define CHARSET_SYMBOL      9
#define CHECKSUM_SYMBOL      10
#define CLOSE_SYMBOL      11
#define COMMENT_SYMBOL      12
#define COMMIT_SYMBOL      13
#define CONTAINS_SYMBOL      14
#define DEALLOCATE_SYMBOL      15
#define DO_SYMBOL      16
#define END_SYMBOL      17
#define EXECUTE_SYMBOL      18
#define FLUSH_SYMBOL      19
#define FOLLOWS_SYMBOL      20
#define FORMAT_SYMBOL      21
#define HANDLER_SYMBOL      22
#define HELP_SYMBOL      23
